import { Route, Redirect } from "react-router-dom";

interface IPrivateRoute {
  component: any;
  rest: { path: string; component: React.FC<{}> };
}

export const PrivateRoute = ({
  component: Component,
  ...rest
}: IPrivateRoute) => {
  return (
    <Route
      {...rest}
      render={(props) =>
        localStorage.getItem("token") ? (
          <Component {...props} />
        ) : (
          <Redirect to="/" />
        )
      }
    />
  );
};
